# -*- coding: utf-8 -*-


class Solution(object):

    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        ans, lefti, righti = 0, 0, 0
        set = {}
        for c in s:
            if not set.has_key(c):
                set[c] = c
                righti += 1
                ans = max(ans, righti - lefti)
            else:
                set.pop(c)
                lefti += 1

        return ans


